script: |
  super -f text -I q9132.spq | sort > q9132.out

inputs:
  - name: q9132.spq
    data: |
      SELECT + col2 * ( + col2 / - 10 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col0 * - col0 / - + 2 NOT BETWEEN ( - + col1 + + 12 ) AND ( col1 ) * col0;
  - name: tab1

outputs:
  - name: q9132.out
    data: |
      -295
      -408
      -864
